import React, { useState } from 'react'

import Card from '../ui/Card';

function UserList(props) {
    return (
        <Card>
            <p>Hello</p>
            <ul>
                {props.users.map((user) => (
                <li key={user.id}>
                    {user.name} ({user.age} years old)
                </li>
                ))}
            </ul>
        </Card>
    )
}

export default UserList
